//search bar, results should create the food list 
import {connect} from 'react-redux'
import SearchPage from '../Components/SearchPage'
import {resetFoodSearch} from '../redux/actions/findFood'

const mapStateToProps = state => {
  console.log('state on food search page? ', state)
  return {
    searchResults: state.searchResults
  }
}

const mapStateToDispatch = (dispatch) => {
  console.log('what is the input you get for the search? ', dispatch)
  return {
    resetFoodSearch: () => dispatch(resetFoodSearch())
  }
}

export default connect(mapStateToProps, mapStateToDispatch)(SearchPage)
